import { useEffect, useState, useCallback } from "react";
import { useParams } from "react-router-dom";

function Testexercise() {
  const { lessonNumber } = useParams();

  const [lesson, setLesson] = useState(null);
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [selectedOption, setSelectedOption] = useState("");
  const [score, setScore] = useState(0);
  const [userAnswers, setUserAnswers] = useState([]);
  const [leaderboard, setLeaderboard] = useState([]);
  const [timeLeft, setTimeLeft] = useState(90);

  // ดึง userId จาก localStorage ให้เป็น number
  const userObj = JSON.parse(localStorage.getItem("userId") || '{}');
  const userId = userObj.user_id || 0;
  const token = localStorage.getItem("token") || "";

  // Fetch lesson
  useEffect(() => {
    fetch(`http://localhost:3000/exercises/lesson/${lessonNumber}`)
      .then(res => res.json())
      .then(data => setLesson(data))
      .catch(err => console.error("Error fetching lesson:", err));
  }, [lessonNumber]);

  // Submit score
  const handleFinish = useCallback(async () => {
    const questions = lesson?.questions || [];
    const finalScore = score;

    // เก็บคำตอบสุดท้าย
    if (currentQuestion < questions.length) {
      const answer = selectedOption || "ไม่ได้เลือก";
      setUserAnswers(prev => [...prev, answer]);
      if (answer === questions[currentQuestion].answer) setScore(prev => prev + 1);
    }

    try {
      if (userId && token) {
        await fetch("http://localhost:3000/scores", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
            "Authorization": `Bearer ${token}`
          },
          body: JSON.stringify({
            user_id: userId,            // ต้องเป็น number
            lesson_number: lessonNumber,
            exercise_id: lessonNumber,
            score: finalScore
          })
        });
      }

      // โหลด leaderboard
      const lbRes = await fetch(`http://localhost:3000/scores?lesson_number=${lessonNumber}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      const lbData = await lbRes.json();
      lbData.sort((a, b) => b.score - a.score);
      setLeaderboard(lbData.slice(0, 5));

    } catch (err) {
      console.error("Save score error:", err);
    }
  }, [currentQuestion, selectedOption, score, lesson, userId, token, lessonNumber]);

  // Timer
  useEffect(() => {
    const timer = setInterval(() => {
      setTimeLeft(prev => {
        if (prev <= 1) {
          clearInterval(timer);
          handleFinish();
          return 0;
        }
        return prev - 1;
      });
    }, 1000);
    return () => clearInterval(timer);
  }, [handleFinish]);

  if (!lesson) return <p>Loading lesson...</p>;

  const questions = lesson.questions;
  const question = questions[currentQuestion];

  const handleNext = () => {
    const answer = selectedOption || "ไม่ได้เลือก";
    setUserAnswers(prev => [...prev, answer]);
    if (answer === question.answer) setScore(prev => prev + 1);

    setSelectedOption("");
    if (currentQuestion + 1 < questions.length) {
      setCurrentQuestion(currentQuestion + 1);
    } else {
      handleFinish();
    }
  };

  return (
    <div>
      <h1>{lesson.title}</h1>
      <p>Question {currentQuestion + 1} / {questions.length}</p>
      <p>{question.question}</p>
      <div>
        {question.options.map((opt, idx) => (
          <button key={idx} onClick={() => setSelectedOption(opt)}>
            {opt}
          </button>
        ))}
      </div>
      <button onClick={handleNext} disabled={!selectedOption}>
        {currentQuestion + 1 < questions.length ? "Next" : "Submit"}
      </button>

      <div>
        <h2>Leaderboard</h2>
        {leaderboard.map((item, idx) => (
          <p key={idx}>{idx + 1}. {item.username} - {item.score}</p>
        ))}
      </div>

      <p>Time left: {timeLeft} sec</p>
    </div>
  );
}

export default Testexercise;
